class Solution:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        def getSupStrMaxLen(str, max):
            # maxLen = 0
            currStr = ''
            for i, item in enumerate(str):
                repeatIndex = currStr.find(item)
                if (repeatIndex != -1):
                    return getSupStrMaxLen(str[repeatIndex + 1::], max)
                currStr = currStr + item
                if (max < i):
                    max = i
                if i == len(str) - 1:
                    return max + 1
            return 0

        return getSupStrMaxLen(s, 0)

